"use strict";

function f_gold(words) {
    let freq = new Array(26).fill(10000);
    for (let word of words) {
        let t = new Array(26).fill(0);
        for (let c of word) {
            t[c.charCodeAt(0) - 'a'.charCodeAt(0)] += 1;
        }
        for (let i = 0; i < 26; i++) {
            freq[i] = Math.min(freq[i], t[i]);
        }
    }
    let res = [];
    for (let i = 0; i < 26; i++) {
        if (freq[i] > 0) {
            res.push(String.fromCharCode(i + 'a'.charCodeAt(0)).repeat(freq[i]));
        }
    }
    return res;
}
